function App() {

const [movies, setMovies ] = useState([])

useEffect(() => {
  fetch(API_URL);
  then(response => response.json())
  then(data => setMovies(data.results) )


}, [])



  return (
    <div className="App">
     {movies.map((movieReq)=><MovieCard/>)}  

    </div>
  );
}

